    int32 TestOptionalInt32 = 23;
    int64 TestOptionalInt64 = 24;
    bool TestOptionalBool = 25;
    string TestOptionalString = 26;
    protogentypes.Bytes TestOptionalBytes = 27;
    protogentypes.Decimal TestOptionalDecimal = 28;
    protogentypes.Date TestOptionalDate = 29;
